import React, { useState, useEffect, useReducer } from 'react';

const Hooks = () => {
  const [count, setCount] = useState(0);

  return (
    <>
      {count}
      <button onClick={setCount(count + 1)}>add</button>
      <button onClick={setCount(count - 1)}>sub</button>
    </>
  )
}

export default Hooks
